#define CYW54591_STATUS_SET_BAUDRATE1 1
#define CYW54591_STATUS_DN_MINI_DRIVER 2
#define CYW54591_STATUS_DN_FW 3
#define CYW54591_STATUS_SET_BAUDRATE2 4
#define CYW54591_STATUS_INIT_DONE 5

uint32_t cyw54591_prepare_pos = 0;
uint8_t *pcyw54591_initscript;

uint8_t cyw54591_status = CYW54591_STATUS_SET_BAUDRATE1;
extern struct bt_pbuf_t *hci_cmd_ass(struct bt_pbuf_t *p, uint8_t ocf, uint8_t ogf, uint8_t len);


static void cyw54591_dn_mini_driver(void)
{
    struct bt_pbuf_t *p;

    BT_VENDOR_TRACE_DEBUG("cyw54591_dn_mini_driver complete\n");

    if((p = bt_pbuf_alloc(BT_TRANSPORT_TYPE, 3, BT_PBUF_RAM)) == NULL)
    {
        BT_VENDOR_TRACE_ERROR("ERROR:file[%s],function[%s],line[%d] bt_pbuf_alloc fail\n",__FILE__,__FUNCTION__,__LINE__);
        return;
    }
    p = (struct bt_pbuf_t *)hci_cmd_ass(p, CYW_HCI_VSC_DOWNLOAD_MINIDRV_OCF, HCI_VENDOR_OGF, 3);
    /* Assembling cmd prameters */
    phybusif_output(p, p->tot_len,PHYBUSIF_PACKET_TYPE_CMD);
    bt_pbuf_free(p);
}

static uint8_t cyw54591_dn_fw(void)
{
	uint8_t download_done = 0;
	struct bt_pbuf_t *p;
	pcyw54591_initscript = (uint8_t *)cyw54591_initscript + cyw54591_prepare_pos;
	if(cyw54591_prepare_pos < sizeof(cyw54591_initscript))
    {
    	uint16_t write_len = 0;
        write_len = pcyw54591_initscript[2];
        BT_VENDOR_TRACE_DEBUG("cyw54591_dn_fw write_len %d\n",write_len);

        if((p = bt_pbuf_alloc(BT_TRANSPORT_TYPE, 3 + write_len, BT_PBUF_RAM)) == NULL)
        {
            BT_VENDOR_TRACE_ERROR("ERROR:file[%s],function[%s],line[%d] bt_pbuf_alloc fail\n",__FILE__,__FUNCTION__,__LINE__);
            return 0;
        }
        memcpy(((uint8_t *)p->payload), pcyw54591_initscript, 3 + write_len);
        /* Assembling cmd prameters */
        phybusif_output(p, p->tot_len,PHYBUSIF_PACKET_TYPE_CMD);
        bt_pbuf_free(p);

        cyw54591_prepare_pos += write_len + 3;
    }
	else
	{
		download_done = 1;
	}
	return download_done;
}



void cyw54591_vendor_set_baud_rate(uint32_t baud_rate)
{
    struct bt_pbuf_t *p;


    BT_VENDOR_TRACE_DEBUG("cyw54591_vendor_set_baud_rate %d\n",baud_rate);
    if((p = bt_pbuf_alloc(BT_TRANSPORT_TYPE, 3 + 6, BT_PBUF_RAM)) == NULL)
    {
        BT_VENDOR_TRACE_ERROR("ERROR:file[%s],function[%s],line[%d] bt_pbuf_alloc fail\n",__FILE__,__FUNCTION__,__LINE__);
        return;
    }
    p = hci_cmd_ass(p, CYW_HCI_VSC_UPDATE_BAUDRATE_OCF, CYW_HCI_VSC_OGF, 3+6);
    ((uint8_t *)p->payload)[3] = 0x00;
    ((uint8_t *)p->payload)[4] = 0x00;
    bt_le_store_32((uint8_t *)p->payload,5,baud_rate);
    /* Assembling cmd prameters */
    phybusif_output(p, p->tot_len,PHYBUSIF_PACKET_TYPE_CMD);
    bt_pbuf_free(p);
}

void cyw54591_vendor_cmd_handle(uint8_t ogf,uint8_t ocf,uint8_t *payload)
{
    BT_VENDOR_TRACE_DEBUG("cyw54591_vendor_cmd_handle ogf(0x%x) ocf(0x%x)\n",ogf,ocf);
 
}


void cyw54591_vendor_init(init_done_cb cb,uint8_t ogf,uint8_t ocf)
{
	BT_VENDOR_TRACE_DEBUG("cyw54591_vendor_init ogf(0x%x) ocf(0x%x) status(%d)\n",ogf,ocf,cyw54591_status);
    switch(cyw54591_status)
    {
    case CYW54591_STATUS_SET_BAUDRATE1:
        cyw54591_vendor_set_baud_rate(BT_BAUDRATE_1);
        cyw54591_status = CYW54591_STATUS_DN_MINI_DRIVER;
        break;
    case CYW54591_STATUS_DN_MINI_DRIVER:
    {
        if(ocf == CYW_HCI_VSC_UPDATE_BAUDRATE_OCF)
        {
        	cyw54591_dn_mini_driver();
            cyw54591_status = CYW54591_STATUS_DN_FW;
			//usleep(250000);
        }
        break;
    }
    case CYW54591_STATUS_DN_FW:
	{
			if(cyw54591_dn_fw())
			{
				hci_reset();
				cyw54591_status = CYW54591_STATUS_SET_BAUDRATE2;
			}
    	}
        break;

    case CYW54591_STATUS_SET_BAUDRATE2:
		if(ocf == CYW_HCI_RESET)
		{
			cyw54591_vendor_set_baud_rate(BT_BAUDRATE_2);
			cyw54591_status = CYW54591_STATUS_INIT_DONE;	
			
		}
        break;
	case CYW54591_STATUS_INIT_DONE:
		phybusif_reopen(BT_BAUDRATE_2);
		//usleep(250000);
		cb(VENDOR_STATUS_INITED);
		
		break;
    default:
        break;
    }
}


void cyw54591_vendor_deinit(void)
{
    cyw54591_prepare_pos = 0;
	cyw54591_status = CYW54591_STATUS_SET_BAUDRATE1;
}


